import React, { Component } from "react";
import Titles from "./components/Titles";

class App extends Component {
  render() {
    return (
      <div>
        <h1>hello App</h1>
        <p>welcome!</p>
        <br />
        <Titles />
      </div>
    );
  }
}

export default App;
